import React from "react";
import axios from "axios";


export default class cities extends React.Component {
  state = {
    cities: []
  }

  componentDidMount() {
    axios.get(`https://localhost:2500/importantCities`)
      .then(res => {
        const cities = res.data;
        this.setState({ cities });
      })
  }

  render() {
    return (
      <ul>
        { this.state.cities.map(cities => <li>{cities.name}</li>)}
        { this.state.cities.map(cities => <li>{cities.country}</li>)}
        { this.state.cities.map(cities => <li>{cities.continent}</li>)}
        { this.state.cities.map(cities => <li>{cities.info}</li>)}
        { this.state.cities.map(cities => <img src={cities.imageUrl} alt="city picture"></img>)}
      </ul>
    )
  }
}
